(1, 'Очки', 'Эти очки помогут вам защититься от воздействия на глаза солнечного света.', 1, 2, 0.1, 'prop_cs_sol_glasses', 0.04, 0, 0),
(2, 'Аксессуар', 'Предмет, с помощью которого можно выделить свою красоту и достаток.', 1, 1, 0.15, 'p_jewel_necklace_02', 0.01, -18, 0),
(3, 'Бронежилет', 'Лучшая защита от пуль - это нападение!', 4, 4, 9, 'prop_armour_pickup', 0.1, -90, 0),
(4, 'Деньги', 'Наличные - не все же деньги держать на карте!', 1, 2, 0.01, 'prop_anim_cash_pile_01', 0.01, 0, 0),
(5, 'VISA', 'Банковская карточка - не забудьте свой пин код!', 1, 1, 0.01, 'prop_cs_credit_card', 0.04, 0, 0),
(6, 'Головной убор', 'Спасает от солнечного удара.', 2, 2, 0.5, 'prop_proxy_hat_01', 0.07, 0, 0),
(7, 'Верхняя одежда', 'Изделие или совокупность изделий, надеваемых человеком.', 3, 2, 0.8, 'prop_ld_tshirt_02', 0.05, 0, 0),
(8, 'Брюки', 'Предмет верхней одежды, покрывающий нижнюю часть туловища и обе ноги.', 3, 2, 0.5, 'prop_ld_jeans_01', 0, 0, 0),
(9, 'Обувь', 'Не советуем вам ходить без обуви по городу.', 1, 2, 0.95, 'prop_ld_shoe_01', 0.05, 0, 0),
(10, 'Серьги', 'Серьги - это главные аксессуары женской красоты.', 1, 1, 0.05, 'p_tmom_earrings_s', 0.05, 0, 0),
(11, 'Часы', 'Обычные наручные часы, которые продаются в любом магазине.', 1, 1, 0.345, 'p_watch_01', 0, 0, 0),
(12, 'Браслет', 'Наденьте этот предмет на руку и вы будете выглядить просто неотразимо.', 1, 1, 0.1, 'p_watch_02', 0.01, 180, 0),
(13, 'Сумка', 'Сумка с ручкой для хранения и переноса в ней всего что захотите.', 4, 4, 0.45, 'prop_cs_heist_bag_02', 0.2, 0, 0),
(14, 'Маска', 'Хорошее украшение для макарада.', 2, 2, 0.14, 'p_trev_ski_mask_s', 0.03, -30, 0),
(15, 'Смартфон', 'Без мобильного телефона в XXI веке как без рук.', 2, 1, 0.14, 'prop_npc_phone', 0.01, -90, 0),
(16, 'Документы', 'Удостоверение личности. Полезная вещь, всегда нужно иметь с собой.', 1, 1, 0.05, 'prop_passport_01', 0, 0, 0),
(17, 'Полицейская дубинка', 'Предмет для самообороны полицейского, или для усмирения хулиганов.', 2, 3, 1, 'w_me_nightstick', 0.02, -90, 0),
(18, 'Фонарик', 'Луч света в темноте.', 1, 2, 1, 'p_cs_police_torch_s', 0.03, 0, 0),
